<div class="content_h">Funktioniert dieses Ersatzteil ( nur bei Gebrauchtartikeln ) ?</div>
<div class="content_text">
<p>Die von uns angebotenen Gebrauchtteile werden in einer Meisterwerkstatt demontiert und mehrfach optisch, sowie auf Funktion, getestet. Sollte trotzdem ein Mangel &uuml;bersehen worden sein, besteht die M&ouml;glichkeit einer schnellen R&uuml;ckgabe.</p>
