<td><span style="FONT-SIZE: 11px"><strong>Klasse 1</strong> - Wasserdicht bei leichtem Regen bzw. Spritzwasser. <br />Sollte das Produkt l&auml;ngere Zeit der Einwirkung von Wasser ausgesetzt sein (starker Regen, Untertauchen), k&ouml;nnte Wasser eindringen</span></td></tr>
<tr>
