Vanwege de kwaliteit van dit product, is het de keuze van vele professionals. Wij leveren deze handschoenen dan ook aan veel sportscholen en leveranciers. Probeer ze zelf, en als je niet tevreden bent, geven wij je graag een ander product f je geld terug. 
